import styled from 'styled-components';

export const Container = styled.section`
  padding: 0px;
  margin: 0px;
`;

export const TodoListWarp = styled.section`
  padding: 0 24px;
`;

export const ListTitle = styled.h2`
  background-color: #8385f6;
  text-align: center;
  padding: 7px 0px;
  font-size: 18px;
  color: white;
  letter-spacing: 15px;
  border-radius: 20px;
`;

export const TodoItemWrap = styled.section`
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
`;
